//import { useQuery, gql } from '@apollo/client';
import React from 'react';
/*
const FEED_QUERY = gql`
  {
    visits {
      id,
      location
    }
  }
`;*/
 const MonitoringPeriod = () => {
 //const { data } = useQuery(FEED_QUERY);

 return (   
    <div class="row">
    <div class="col-lg-12 col-md-6 col-12">
        <div class="card">
            
            
            
        <section id="basic-button-group">
        <div class="row">
            <div class="col-12">
            <div class="card">             
                <div class="card-content">
                <div class="card-body">
                    <p>Group a series of buttons together on a single line with the button group. Wrap a series of buttons with <code>.btn</code> in <code>.btn-group</code></p>
                    <div class="row">
                    <div class="col-12 col-md-6 mb-2 mb-md-0">                    
                        <div class="btn-group" role="group">
                        <button type="button" class="btn btn-primary">Left</button>
                        <button type="button" class="btn btn-outline-primary">Middle</button>
                        <button type="button" class="btn btn-outline-primary">Right</button>
                        </div>
                    </div>
                    <div class="col-12 col-md-6">                     
                        <div class="btn-group" role="group">
                            <button type="button" class="btn btn-outline-primary"><i class="ft-facebook"></i></button>
                            <button type="button" class="btn btn-primary"><i class="ft-twitter"></i></button>
                            <button type="button" class="btn btn-outline-primary"><i class="ft-instagram"></i></button>
                        </div>
                    </div>
                    </div>
                </div>
                </div>
            </div>
            </div>
        </div>
        </section>




        </div>
    </div>

</div>

);
};

export default MonitoringPeriod;
